export default {
  __name: 'FilePreview',
  props: {
	file: { type: Object, required: true },
	tag: { type: String, default: 'li' },
},
  emits: ['remove'],
  setup(__props, { expose }) {
  expose();





const __returned__ = {  }
Object.defineProperty(__returned__, '__isScriptSetup', { enumerable: false, value: true })
return __returned__
}

}
